column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli అనునది JSON ఆకృతీకరణ దత్తాంశం మరియు ఆకృతీకరణను కలిగివున్న ఫైలు పేరు రెంటినీ ఆమోదించగలదు. తరువాతి కేస్ నందు ఫైలు చదువబడును మరియు కాంటెంట్స్ ఈ లక్షణం నందు ఉంచబడును.

ఉదాహరణలు: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
వాడుక: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  స్థితి

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
వాడుక: nmcli general status { help }

నెట్వర్కుమేనేజర్ యొక్క మొత్తం స్థితిని చూపును.
'status' అనునది అప్రమేయ చర్య, దానర్ధం 'nmcli gen' అనునది 'nmcli gen status' పిలుచును

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
వాడుక: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
వాడుక: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

అన్ని రేడియో స్విచ్చుల స్థితిని పొందును, లేదా వాటిని ఆన్/ఆఫ్ చేయును.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
వాడుక: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

వై-ఫై రేడియో స్విచ్ స్థితిని పొందును, లేదా ఆన్/ఆఫ్ చేయును.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
వాడుక: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

మొబైల్ బ్రాడ్‌బాండ్ రేడియో స్విచ్ స్థితి పొందును, లేదా దానిని ఆన్/ఆఫ్ చేయును.
